import React, { Component } from "react";
import './main.css'
import { Link } from "react-router-dom";
import { withRouter } from "react-router-dom"
import { connect } from "react-redux"


class App extends Component {
  render() {
    return (
      <div class="main">
        <p class="title"> Innovatov </p>

        <Link class= "email" to="/About"> About </Link>
        <Link class= "email" to="/Contact"> Contact </Link>
      </div>



    );
  }
}


const mapStateToProps = state => ({
  loggedInUser: state.loggedInUser,
  displayname: state.userData.displayName,
  username: state.userData.username,
  about: state.userData.about,
  numOfPosts: state.userData.messages.length
});

const mapDispatchToProps = dispatch => {
  return {
    addTweet: tweet => dispatch(addTweet(tweet)),
    GetUserByID: () => dispatch(getUserByID())
  };
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(App);
